} /// View the front page.
async fn drupal_memcache_front_page(user: &mut GooseUser) -> TransactionResult { let mut goose = user.get("/").await?; match goose.response { Ok(response) => { // Copy the headers so we have them for logging if there are errors. let headers = &response.headers().clone(); match response.text().await { Ok(t) => { let re = Regex::new(r#"src="(.*?)""#).unwrap(); // Collect copy of URLs to run them async let mut urls = Vec::new(); for url in re.captures_iter(&t) { if url[1].contains("/misc") || url[1].contains("/themes") { urls.push(url[1].to_string()); } } for asset in &urls { let _ = user.get_named(asset, "static asset").await; } } Err(e) => { // This will automatically get written to the error log if enabled, and will // be displayed to stdout if `-v` is enabled when running the load test. return user.set_failure( &format!("front_page: failed to parse page: {}", e), &mut goose.request, Some(headers), None, ); } } } Err(e) => { // This will automatically get written to the error log if enabled, and will // be displayed to stdout if `-v` is enabled when running the load test. return user.set_failure( &format!("front_page: no response from server: {}", e), &mut goose.request, None, None, ); } } Ok(())
} /// View a node from 1 to 10,000, created by preptest.sh.
async fn drupal_memcache_node_page(user: &mut GooseUser) -> TransactionResult { let nid = rand::thread_rng().gen_range(1..10_000); let _goose = user.get(format!("/node/{}", &nid).as_str()).await?; Ok(())
