The WebSocket Controller supports the same commands listed in the telnet controller . Requests and Responses are in JSON format. Requests must be made in the following format: {"request":String} For example, a client should send the follow json to request the current load test metrics: {"request":"metrics"} Responses will always be in the following format: {"response":String,"success":Boolean} For example: % websocat ws://127.0.0.1:5117
foo
